import React from "react";
import { FaUser, FaUserFriends, FaPlus, FaUpload, FaSchool, FaTrophy, FaCog, FaSignOutAlt } from "react-icons/fa";

export default function DashboardLayout({ children, school, user, onLogout }) {
  // Fallbacks for logo/initial if missing
  const schoolName = school?.name || "School";
  const schoolInitial = schoolName.charAt(0);

  return (
    <div className="flex h-screen bg-athletiq-cream">
      {/* Sidebar */}
      <aside className="w-64 bg-athletiq-navy text-white flex flex-col">
        {/* Logo */}
        <div className="flex items-center gap-3 p-6 border-b border-athletiq-blue">
          <img src="/logo512.png" alt="ATHLETIQ" className="h-8 w-8" />
          <div>
            <div className="text-2xl font-extrabold tracking-wide">ATHLETIQ</div>
            <div className="text-xs text-athletiq-gray">Track the Rise, Train the Future</div>
          </div>
        </div>
        {/* Nav */}
        <nav className="flex-1 py-4 px-2 space-y-1">
          <NavItem icon={<FaUser />} label="Dashboard" href="/school-dashboard" />
          <NavItem icon={<FaUserFriends />} label="Player Roster" href="/school-dashboard" />
          <NavItem icon={<FaPlus />} label="Add Player" href="#" />
          <NavItem icon={<FaUpload />} label="Bulk Upload" href="#" />
          <NavItem icon={<FaSchool />} label="School Profile" href="#" />
          <NavItem icon={<FaTrophy />} label="Tournament Stats" href="#" />
          <NavItem icon={<FaCog />} label="Settings" href="#" />
        </nav>
      </aside>

      {/* Main Content */}
      <div className="flex-1 flex flex-col">
        {/* Header */}
        <header className="flex items-center justify-between px-8 py-4 bg-athletiq-blue text-white shadow">
          <div className="flex items-center gap-4">
            <div className="text-2xl font-bold">School Dashboard</div>
          </div>
          <div className="flex items-center gap-4">
            <span className="font-semibold text-base">{schoolName}</span>
            <span className="h-10 w-10 bg-athletiq-green text-athletiq-navy rounded-full flex items-center justify-center text-lg font-bold">
              {schoolInitial}
            </span>
            <button
              className="ml-4 bg-athletiq-navy hover:bg-athletiq-green text-white font-semibold px-4 py-2 rounded flex items-center gap-2"
              onClick={onLogout}
            >
              <FaSignOutAlt /> Logout
            </button>
          </div>
        </header>

        {/* Page Content */}
        <main className="flex-1 p-8 overflow-y-auto bg-athletiq-cream">
          {children}
        </main>
      </div>
    </div>
  );
}

// Nav item helper
function NavItem({ icon, label, href }) {
  return (
    <a
      href={href}
      className="flex items-center gap-3 px-4 py-2 rounded hover:bg-athletiq-blue/80 transition cursor-pointer text-base"
    >
      <span>{icon}</span>
      <span>{label}</span>
    </a>
  );
}
